import React, { Fragment } from 'react';
//import { Link } from 'react-router-dom'
import { Container, Header } from 'semantic-ui-react';
import Menu from '../registro_components/Menu'
import Headertop from '../registro_components/pagHeader'



function home() {
    return (
        <div>
            <Fragment>
                <Menu />
                <Container>
                    <Headertop />
                    <div className="nombreActividad">
                        <div>
                            <Header size="large" > Home </Header>
                        </div>
                    </div>
                </Container>
            </Fragment>
        </div>
    );
}
export default home;
